    "2013-03-28T01:14:50.869611",nt"name": "dnr-100k-lakes-and-rivers-fisheries-experimental-and-special-regulations",nt"isopen":
    false,nt"url": null,nt"notes": "This layer represents lakes and rivers
    having experimental or special regulations for fishing. The existing regulations
    for the current fishing season are shown. This layer will be updated twice yearly:
    Spring (with existing regulations for the current season) and Late Summer (with
    proposed regulations for the next year's season). This polygon layer is a subset
    of the DNR 100K Lakes and Rivers layer and follows the same cartographic lineage.
    NOTE: This layer DOES NOT include trout stream regulations. See GIS layers: Streams
    with Trout Regulations and Streams with Winter Trout Regulations.",nt"license_title":
